script: |
  super -f text -I q12750.spq | sort > q12750.out

inputs:
  - name: q12750.spq
    data: |
      SELECT ALL col2 FROM tab0 (FORMAT parquet) WHERE NOT + col1 NOT BETWEEN + col2 / col2 * col0 - + col0 AND col1 * + col1;
  - name: tab0

outputs:
  - name: q12750.out
    data: |
      10
      47
      99
